/* Container for the gallery */
.gallery-container {
    max-width: 1200px;
    margin: 0 auto;
    padding: 20px;
    text-align: center;
  }
  
  /* Gallery title */
  .gallery-title {
    font-size: 2rem;
    margin-bottom: 20px;
    color: #333;
  }
  
  /* Container for images */
  .gallery-images {
    display: flex;
    flex-wrap: wrap;
    gap: 20px;
    justify-content: center;
  }
  
  /* Style for each image card */
  .image-card {
    position: relative;
    width: 300px;
    height: 200px;
    overflow: hidden;
    border-radius: 10px;
    box-shadow: 0 4px 8px rgba(0, 0, 0, 0.2);
  }
  
  /* Style for the image */
  .gallery-image {
    width: 100%;
    height: 100%;
    object-fit: cover;
    transition: transform 0.3s ease;
  }
  
  /* Hover effect for images */
  .image-card:hover .gallery-image {
    transform: scale(1.1);
  }
  
  /* Optional: Add a custom background color or border if needed */
  .image-card {
    background-color: #f8f8f8;
    border: 2px solid #ddd;
  }
